import React from 'react'


const Instructor = () => {
    return (
        <div className="container">
            <div className="row justify-content-center">
                <div className="col-md-10">
                    <div className="card mt-5 p-5">
                        <h4>Estudiante</h4>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Instructor;
